Big Tits In Uniform - Haley Cummings - Constructawhore

October 23, 2010

It is a hard day on the construction site. The project is falling behind, and the crew is nowhere to be found. So Haley steps out to do what she does best, taking a hold of the situation and working hard to get results. Her dedication proves successful as she Jackhammers, measures, cuts, carries, and moves in all the right ways. When her project supervisor Dante pays a visit to review the work, he is impressed by her devotion, thanking her in the only appropriate way he knows how - by drilling her on site!

Pornstars: Haley Cummings, Dante Brice
